import React, { Component } from 'react';
import { Icon, Button } from 'antd';

//화학 약품 하나에 대한 거 (my Lab 화면 중에)
class Member extends Component {

    state = {
        visible: false
    }

    constructor(props) {
        super(props);
    }

    showModal = () => {
        this.setState({
            visible: true,
        });
    };

    handleOk = e => {
        console.log(e);
        this.setState({
            visible: false,
        });
    };

    handleCancel = e => {
        console.log(e);
        this.setState({
            visible: false,
        });
    };

    render() {
        return (
            <span>
                <center>
                    {/* 버튼 */}
                    <Icon type="smile" />
                </center>
                <center>
                    {this.props.members.name}
                </center>
            </span>
        );
    }
}

export default Member;
